  margin: 0;
  padding: 0;
  box-sizing: inherit;
}

html {
  /* font-size: 10px(1rem) */
  font-size: 62.5%;
  font-family: 'Noto Serif SC', serif;
}

body {
  box-sizing: border-box;
  color: $color--font;
  background-image: url('../images/dark_wall.png');
}

h1,
h2,
h3,
h4 {
  margin-bottom: 1.2em;
}
h1 {
  font-size: 2.5rem;
}
h3 {
  font-size: 2rem;
}
h4 {
  font-size: 1.5rem;
}
a {
  text-decoration: none;
  color: $color--font;
  outline: none;
}

a:hover,
a:focus {
  color: #ffffff;
  outline: none;
}
img {
  max-width: 100%;
}

// Nav
.navbar {
  z-index: 10000;
  position: fixed;
  top: 0;
  height: auto;
