    display: none;
  }
  .nav-links {
    text-decoration: none;
    color: $color--font;
    font-size: 1.5rem;
    cursor: pointer;
  }
  .main-nav li {
    text-align: center;
    margin: 15px auto;
  }
  .logo {
    display: inline-block;
    height: 70px;
    width: 70px;
    background-image: url('../images/logo.png');
    background-size: cover;
    background-position: center;
    margin-left: 2em;
    cursor: pointer;
    margin-top: 10px;
    margin-left: 20px;
  }
  &-toggle {
    position: absolute;
