li {
  position: relative;
  color: inherit;
  text-decoration: none;
  line-height: 1em;
  &:before,
  &:after {
    content: '';
    position: absolute;
    transition: transform 0.3s ease;
  }
}
.hover-effect {
  padding: 0.5em;
  display: inline-block;
  overflow: hidden;
  &:before,
  &:after {
    left: 0;
    width: 100%;
    height: 1px;
    background: rgba(255, 255, 255, 0.7);
  }
  &:before {
    bottom: 0;
    transform: translateX(-100%);
  }
  &:after {
    top: 0;
    transform: translateX(100%);
  }
  &:hover:before,
  &:hover:after {
    transform: translateX(0);
  }
}
.history,
.team,
.mission,
.history-pic,
.team-pic,
.mission-pic {
  opacity: 0;
  transition: all 0.5s ease-in-out;
}

.visible {
  opacity: 1;
